import React from 'react';
import GameCanvas from './GameCanvas';
import '../styles/AzureCloudShooter.css';

const CloudShooter = () => {
  // Add this to debug the URL
  console.log("SVG URL:", `${process.env.PUBLIC_URL}/azure-icons/Microsoft_Azure_Cyan.svg`);

  return (
    <div id="azure-cloud-shooter">
      <GameCanvas />
      <h1 
        className="gameCanvas-game-title" 
        style={{ '--azure-icon': `url(${process.env.PUBLIC_URL}/azure-icons/Microsoft_Azure_Cyan.svg)` }}
      >
        ZURE CLOUD SHOOTER
      </h1>
    </div>
  );
};

export default CloudShooter;
